  false,\n\t\"url\": null,\n\t\"notes\": \"Single-beam bathymetry and magnetics data
  along with DGPS navigation data was collected as part of field activity F-4-84-WO
  in Washington, Oregon from 07/11/1984 to 08/15/1984, http://walrus.wr.usgs.gov/infobank/f/f484wo/html/f-4-84-wo.meta.html
  The geophysical source was a Knudsen 12 kHz 320B/R echosounder. These data are reformatted
  from space-delimited ASCII text files located in the Coastal and Marine Geology
  Program (CMGP) InfoBank field activity catalog at http://walrus.wr.usgs.gov/infobank/f/f484wo/html/f-4-84-wo.bath.html
  into MGD77T format provided by the NOAA's National Geophysical Data Center(NGDC).
  The MGD77T format includes a header (documentation) file (.h77t) and a data file
  (.m77t). More information regarding this format can be found in the publication
  listed in the Cross_reference section of this metadata file.\",\n\t\"license_title\":
